#include <stdio.h>

int prefunc(int y1, int y2) {
    if (y1 <= 0 || y2 <= 0) {
        return 0;
    }
    if (y1 == y2) {
        return y1;
    }
    if (y1 > y2) {
        return prefunc(y1 - y2, y2);
    }
    return prefunc(y1, y2 - y1);
}

